We are so excited to announce our film, 𝐁𝐞𝐟𝐨𝐫𝐞 𝐈 𝐆𝐨 is finally finished! 🎥 I could not be more grateful and proud of the powerful narrative we have crafted. We wanted to share a “First Look” of our poster as we embark on the film festival circuit. Thank you to every single person who supported us on this journey - we cannot wait for you all to see it on the big screen! 🍿 

Synopsis: BEFORE I GO is a psychological drama that follows Emily, a once vibrant and beautiful woman, as she confronts her ex-boyfriend for the first time since he sold her into sex-trafficking years prior. As their conversation unfolds, we peel back the layers of their characters as they wrestle with their fragmented past and the emotional pain Emily has endured. This dangerous and dramatic encounter blurs the line between reality and imagination as Emily grapples with how Tristan has stripped her of her youth, her innocence and her identity. Will Emily get the revenge and closure that she has longed for? 🦟

